#!/usr/bin/env python3
import os
import json
import base64
import hashlib
import requests
from Crypto.Cipher import AES, PKCS1_OAEP
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from datetime import datetime

# Définition des fonctions de déchiffrement
def decrypt_data(encrypted_data, key):
    try:
        encrypted_data = base64.b64decode(encrypted_data)
        iv, ct = encrypted_data[:16], encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        return unpad(cipher.decrypt(ct), AES.block_size).decode()
    except Exception as e:
        print(f"Erreur de déchiffrement: {e}")
        return None

def decrypt_key_with_rsa(encrypted_key, private_key):
    return PKCS1_OAEP.new(private_key).decrypt(base64.b64decode(encrypted_key))

# Configuration
SCRIPT_BASE_NAME = "IPToP_1.4.py_encrypted"
GITHUB_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main"

def check_for_updates():
    try:
        response = requests.get(f"{GITHUB_URL}/{SCRIPT_BASE_NAME}.metadata.json", timeout=10)
        if response.status_code == 200:
            remote_meta = response.json()
            with open(f"{SCRIPT_BASE_NAME}.metadata.json") as f:
                local_meta = json.load(f)
            return remote_meta["version"] > local_meta["version"]
    except Exception:
        return False
    return False

def perform_update():
    try:
        files = [".metadata.json", ".sha256", "_ready_to_use.py"]
        for suffix in files:
            response = requests.get(f"{GITHUB_URL}/{SCRIPT_BASE_NAME}{suffix}", timeout=10)
            if response.status_code == 200:
                with open(f"{SCRIPT_BASE_NAME}{suffix}", 'wb') as f:
                    f.write(response.content)
        return True
    except Exception:
        return False

if __name__ == "__main__":
    if check_for_updates() and perform_update():
        print("Mise à jour réussie. Relancez le script.")
        exit()

    try:
        with open(f"{SCRIPT_BASE_NAME}.metadata.json") as f:
            metadata = json.load(f)
        
        with open("private_key.pem") as f:
            private_key = RSA.import_key(f.read())
        
        decrypted_script = decrypt_data(
            """""",
            decrypt_key_with_rsa(metadata["encrypted_key"], private_key)
        )
        
        if decrypted_script and datetime.now() <= datetime.strptime(metadata["expiration_date"], "%Y-%m-%d"):
            exec(decrypted_script)
    except Exception as e:
        print(f"Erreur: {str(e)}")
